// src/pages/Cabin3.js
import React from 'react';

function Cabin3() {
  return (
    <main role="main">
      <h1>Cabin 3</h1>
      <p>Coming soon! Check back later for information about our third cabin.</p>
    </main>
  );
}

export default Cabin3;
